import React, {Component} from 'react';
import Nav from 'react-bootstrap/Nav';
import {Col, Row, Container} from 'react-bootstrap';
import '././css/EachStock.css';
import StockCharts from './StockCharts';
import KeyM from './StockCharts';

class EachStock extends Component {
    render(){

        return(
            <div>
            <Nav id = "options" as="ul">
                <Nav.Item as="li">
                    <Nav.Link>Quote</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link>Future Growth</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link >Valuation</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link>Financial Health</Nav.Link>
                </Nav.Item>
                <Nav.Item as="li">
                    <Nav.Link >Company information</Nav.Link>
                </Nav.Item>
            </Nav>
            <Container id = "layout">
                <Row>
                    <Col xs={6}><StockCharts/></Col>
                    <Col xs={6}><KeyMetric/></Col>
                </Row>
            </Container>
            </div>
        );
    }
}
export default EachStock;
